import React, { useState } from 'react';
import { Container, Typography, List, ListItem, ListItemText, Divider, Paper } from '@mui/material';
import { useParams } from 'react-router-dom';
import Draggable, {DraggableCore} from "react-draggable";


const PreDefinedPath = ({ pathways }) => {
  const Draggable = require('react-draggable');
  const DraggableCore = Draggable.DraggableCore;
  return (
    <Draggable>
      <div className="App">
        <h1>I can now be moved around!</h1>
      </div>
    </Draggable>
  );
};

export default PreDefinedPath;
